Christian went over to jolly old England this week to find us a new girl and he didn't disappoint. He met a perky blonde teen with glasses that was as cute as she was giddy. Satine Sparks was her name and being too amazingly adorable was her game. She came in with a big book bag which added to her looking innocent. She was a student at the University and she was studying marketing. What an shy girl you're probably thinking but she also told us she did a couple bukake scenes for the first time the other day and loved it.
